import React, { Component } from "react";

class imageitems extends Component {
  render() {
    return (
      <div className="grid">
        <div>
          <article>
            <div className="wrap">
              <div className="Wrap-item">
                <a href="#"><img src="./images/cardimg1.jpg"></img></a>
              </div>
            </div>
            <div className="content">
              <h3>Meta Sumunjang Art Fair</h3>
              <span>ART FAIR,EXHIBITION,METAVERSE</span>
            </div>
          </article>
        </div>
      </div>
    );
  }
}

export default imageitems;
